import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Find and click a product card to open the modal
    // Using a combination of class and text to be more specific
    const productCard = page.locator('.product-card', { hasText: 'Apple iPhone 15 Pro Max' }).first();
    await productCard.waitFor({ state: 'visible', timeout: 5000 });
    await productCard.click();

    // 2. Wait for the modal to be visible
    const modal = page.locator('#productModal');
    await modal.waitFor({ state: 'visible', timeout: 5000 });

    // Take screenshot with modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract display style of the modal when it's open
    const displayStyleBefore = await modal.evaluate(el => window.getComputedStyle(el).display);

    // 3. Press the Escape key to close the modal
    await page.keyboard.press('Escape');

    // 4. Wait for the modal to be hidden
    await modal.waitFor({ state: 'hidden', timeout: 5000 });

    // Take screenshot after modal is closed
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    // Extract display style of the modal after it's closed
    const displayStyleAfter = await modal.evaluate(el => window.getComputedStyle(el).display);

    return {
      success: true,
      action: "Successfully opened a product modal, closed it using the Escape key, and verified its visibility state.",
      extractedData: {
        modalDisplayStyleBefore: displayStyleBefore,
        modalDisplayStyleAfter: displayStyleAfter
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    const screenshots = [];
    try {
        const errorPath = path.join(screenshotsDir, 'error_screenshot.png');
        await page.screenshot({ path: errorPath });
        screenshots.push(errorPath);
    } catch (e) {
        // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to close modal with Escape key",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
